import React from "react"

class NavigationButton extends React.Component {
  constructor(props) {
    super(props) 
    this.state = {
      page: this.props.page
    }

    this.handleChange = this.handleChange.bind(this)
  }

  handleChange() {
    this.props.changePageValue(this.state.page)
  }
  page = `${this.props.page * 50 + 1} - ${this.props.page * 50 + 50 }`
  render() {
    return (
      <button className="navigation-button" onClick={this.handleChange}>
        {this.page}
      </button>
    )
  }
}

export default NavigationButton
